/**
 * Credit card background type
 * available background gradients for credit card in Theme.
 * default gradients are defined under `$payment-card-default-background-map` theme variable and can be customized with `$payment-card-custom-background-map`
 */
export declare type CreditCardBackgroundType = 'primary-card' | 'blue-card' | 'black-card' | 'gold-card' | 'green-card' | 'card-red' | 'darkorange-card' | 'darkred-card' | 'darkviolet-card';
